import React, { FC, memo } from 'react';
import Section from '../Section/Section';
import SingleExperience from './SingleExperience';

const Experience: FC = () => {
  return (
    <Section>
      <div id='experience' className='Experience'>
        <h2>Experience</h2>
        <SingleExperience name='Eyas Gaming' />
        <SingleExperience name='Anvilo' />
        <article>
          <h3>Software Developer</h3>
          <h4>Feb 2018 - Mar 2020</h4>
          <p>
            <a href='https://mentormate.com/'>Mentor Mate</a>
          </p>
          <p>
            Contributed to the team goals and worked on tasks covering the
            entire code base development lifecycle.
          </p>
          <p>Developed new and supporting existing features.</p>
          <p>
            Implemented creative solutions for web platforms used by thousands
            of customers.
          </p>
          <p>Develop fully responsive web pages for company&apos;s clients.</p>
          <p>Constantly improve quality of the codebase.</p>
        </article>
      </div>
    </Section>
  );
};

export default memo(Experience);
